  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0108061 includes discrete
  sample and profile data collected from NOAA Ship RONALD H. BROWN in the North Atlantic
  Ocean and South Atlantic Ocean from 2003-06-04 to 2003-08-11. These data include
  CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12
  (CFC-12), DELTA CARBON-13, DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED INORGANIC
  CARBON (DIC), DISSOLVED ORGANIC CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE,
  NEON, NITRATE, NITRITE, Partial pressure (or fugacity) of carbon dioxide - water,
  Potential temperature (theta), SALINITY, TOTAL ALKALINITY (TA), Total Dissolved
  Nitrogen (TDN), Tritium (Hydrogen isotope), WATER TEMPERATURE, pH, phosphate and
  silicate. The instruments used to collect these data include Alkalinity titrator,
  CTD, Carbon dioxide (CO2) gas analyzer, Coulometer for DIC measurement, Flask with
  closed headspace for discrete carbon dioxide (CO2) measurement, bottle and spectrophotometer.nnThese
  data were collected by Frank J. Millero of Rosenstiel School of Marine and Atmospheric
  Science, Rik Wanninkhof of US DOC; NOAA; OAR; Atlantic Oceanographic and Meteorological
  Laboratory and Richard A. Feely of US DOC; NOAA; OAR; Pacific Marine Environmental
  Laboratory as part of the CLIVAR_A16N_2003 data set. CDIAC associated the following
  cruise ID(s) with this data set: CLIVAR_A16N_2003nnThe International CLIVAR Global
  Ocean Carbon and Repeat Hydrography Program carries out a systematic and global
  re-occupation of select WOCE/JGOFS hydrographic sections to quantify changes in
  storage and transport of heat, fresh water, carbon dioxide (CO2), and related parameters.\",\n\t\"owner_org\":
